import React from "react";
import { View, Text, SafeAreaView } from "react-native";
import HeaderTabs from "../components/HeaderTabs";

function Home(params) {
  return (
    <SafeAreaView
      style={{
        backgroundColor: "#eee",
        flex: 1,
      }}
    >
      <View>
        <HeaderTabs></HeaderTabs>
      </View>
    </SafeAreaView>
  );
}

export default Home;
